import { FiPlusSquare } from 'react-icons/fi';
import { Container, Div, Button, Image } from './styles';
import Logo from '../../assets/Logo.png';

interface Props {
  openModal: () => void;
}

export default function Header({ openModal }: Props) {
  return (
    <Container>
      <Div>
        <Image src={Logo} width="200px" height="200px" alt="Startinha" />
        <Button
          type="button"
          onClick={openModal}
        >
          Novo Prato
        </Button>
      </Div>
    </Container>
  )
}
